import { useState } from "react"
import { GameObject } from "./GameObject"

export const Hierarchy = () => {
  const [state, setState] = useState(0)

  const reloadFiles = () => {
    setState(state + 1)
  }

  return <div
    style={{
      overflow: `scroll`,
      userSelect: `none`
    }}
  >
    <GameObject
      object={window.files.scenes[window.editor.seletedScene]}
      main={true}
    />
    <div
      style={{
        cursor: `pointer`
      }}
    >
      + Add New GameObject
    </div>
  </div>
}
